import './App.css';

import React, {Component} from 'react';
import Navbar from './components/navbar/Navbar';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

class App extends Component {
  render() {
    return (
      <div>
        <Navbar/>
        <img src="./accueil.jpg" alt="bla"/>
      </div>
    );
  }
}

export default App;
